import React from 'react';
import s from "./Profile.module.css";
import MyPosts from './MyPosts/MyPosts';


const Profile = () => {
    return (
        <div className={s.content}>

            <div>
                <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/8/8d/Panorama_of_Denver%2C_Colorado%2C_1898.jpg/1200px-Panorama_of_Denver%2C_Colorado%2C_1898.jpg" />
            </div>
            <div>
                <MyPosts />
     </div>
        </div>
    );
}

export default Profile;
